// import App from "../App";
import { Container } from "reactstrap";
import Base from "./../components/Base";

const About = () => {
  return (
    <Base>
      <Container>
        <p>
          "Welcome to [Blog Name], a platform dedicated to [primary topic] for
          [target audience description]. [Author name], a passionate [relevant
          expertise], created this blog to [explain the purpose, e.g., "share
          insights," "provide practical advice," "spark conversation"] on [key
          topics]. We strive to deliver well-researched content with a
          [distinctive style, e.g., "engaging," "accessible"] approach, so you
          can [benefit to the reader, e.g., "stay informed," "make informed
          decisions," "gain new perspectives"]. Join us on this journey to
          explore the world of [topic]!"
        </p>
		</Container>
    </Base>
  );
};

export default About;
